import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MenuComponent } from './menu/menu.component';
import { FaixaComponent } from './faixa/faixa.component';
import { SlideComponent } from './slide/slide.component';
import { FooterComponent } from './footer/footer.component';
import { CardComponent } from './card/card.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { CarouselComponent } from './carousel/carousel.component';
import { TextoCarouselComponent } from './texto-carousel/texto-carousel.component';
import { CarrosselComponent } from './carrossel/carrossel.component';
import { TextoCarrosselComponent } from './texto-carrossel/texto-carrossel.component';

@NgModule({
  declarations: [
    AppComponent,
    MenuComponent,
    FaixaComponent,
    SlideComponent,
    FooterComponent,
    CardComponent,
    CarouselComponent,
    TextoCarouselComponent,
    CarrosselComponent,
    TextoCarrosselComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
